import Head from "next/head";
import Circle from "public/images/circle-accent-1.svg";
import Header from "src/parts/Header";
import Hero from "src/parts/Hero";
import Clients from "src/parts/Clients";
import ListCourses from "src/parts/ListCourses";
import ListCategories from "src/parts/ListCategories";
import Footer from "src/parts/Footer";
import courses from "src/constants/api/courses";

function Home({ data }) {
  return (
    <>
      <Head>
        <title>BWAMICRO</title>
      </Head>
      <main>
        <section className="header-clipping pt-10 min-h-screen md:min-h-0">
          <div className="sunshine max-w-full"></div>
          <svg id="accent-circle" width="273" height="283" viewBox="0 0 273 283" fill="none" xmlns="http://www.w3.org/2000/svg">
    <circle cx="69.5" cy="203.5" r="203" stroke="#4D55BC" />
    <circle opacity="0.9" cx="56.5" cy="216.5" r="190" stroke="#4D55BC" />
    <circle opacity="0.8" cx="39.5" cy="237.5" r="181" stroke="#4D55BC" />
    <circle opacity="0.7" cx="27" cy="256" r="167.5" stroke="#4D55BC" />
    <circle opacity="0.6" cx="10" cy="269" r="155.5" stroke="#4D55BC" />
    <circle opacity="0.5" cx="-7.5" cy="286.5" r="138" stroke="#4D55BC" />
    <circle opacity="0.4" cx="-24" cy="303" r="121.5" stroke="#4D55BC" />
</svg>
          <Circle className="absolute left-0 bottom-0"></Circle>
          <div className="container mx-auto px-4">
            <Header />
            <Hero />
          </div>
        </section>
        <section className="container px-4 mx-auto md:pt-24">
          <Clients />
        </section>
        <section className="container px-4 mx-auto md:pt-24">
          <ListCourses data={data} />
        </section>
        <section className="container px-4 mx-auto md:pt-24">
          <ListCategories />
        </section>
        <section className="mt-24 bg-indigo-1000 py-12">
          <Footer />
        </section>
      </main>
    </>
  );
}

Home.getInitialProps = async () => {
  try {
    const data = await courses.all();
    return { data: data.data };
  } catch (error) {
    console.error(error);
    return { data: [] };
  }
};

export default Home;
